// import ExpenseItem from "./components/ExpenseItem";

function Expenses(props){
    return (
        <div>

            <h2>Let's get started!</h2>
            <ExpenseItem title={por[0].title} amount={por[0].amount} date={por[0].date} />
            <ExpenseItem title={por[1].title} amount={por[1].amount} date={por[1].date} />
            <ExpenseItem title={por[2].title} amount={por[2].amount} date={por[2].date} />
            <ExpenseItem title={por[3].title} amount={por[3].amount} date={por[3].date} />
        </div>
    );
}

export default Expenses;
